import React from 'react'

export default function Home() {
  const img="https://t3.ftcdn.net/jpg/02/65/16/98/360_F_265169821_CnQKJoI8Aifk4gNdJJPCRNOgCty2E4JH.jpg"
  return (
    <div>
      {/* <h1 style={{textAlign:'center'}}>Home Page</h1> */}
        <div style={{width:'100%',display:'flex'}}>
          {/* <div style={{width:'20%',marginLeft:20,backgroundColor:'lightsteelblue'}}>
            <h1>Welcome</h1>
            <h2>Good Morning. . . </h2>
            <h3>Have a good day</h3>
          </div> */}
          <div style={{width:'70%'}}>
            <img src={img} height={600} width={1100}/>
          </div>
        </div>
    </div>
  )
}
